description:
Journey to Normandy

War Documentary hosted by Brian Williams, published by NBC in 2014 - English narration


Information
------------------------------

On the 70th anniversary of D-Day, four veterans make the long journey back to Normandy, probably for the last time, to the places that changed them - and the world -- forever. They vividly describe to Brian Williams the terrifying moments as they landed in German-occupied Normandy, France.

